mapper.select:

select 

from RMBTCH
where RMBTCH_SENDER_BANK = #{rmbtchSenderBank,jdbcType=CHAR}
  and RMBTCH_REMDATE = #{rmbtchRemdate,jdbcType=CHAR}
  and RMBTCH_TIMES = #{rmbtchTimes,jdbcType=VARCHAR}
  and RMBTCH_FEPNO = #{rmbtchFepno,jdbcType=CHAR}

mapper.delete:

delete from RMBTCH
where RMBTCH_SENDER_BANK = #{rmbtchSenderBank,jdbcType=CHAR}
  and RMBTCH_REMDATE = #{rmbtchRemdate,jdbcType=CHAR}
  and RMBTCH_TIMES = #{rmbtchTimes,jdbcType=VARCHAR}
  and RMBTCH_FEPNO = #{rmbtchFepno,jdbcType=CHAR}
